import React from "react";
import { Typography, AppBar, Button, CssBaseline, Grid, Toolbar, Container, Tabs, Tab, Box } from '@material-ui/core'

import ParticipantFilter from './ParticipantFilter';
import ParticipantList from './ParticipantList'

import useStyles from "./styles";

const App = () => {
    const cards = [1,2,3,4,5,6,7,8,9]
    const [selectedTab, setSelectedTab] = React.useState(0);
    const handleChange = (event, newValue) => {
        setSelectedTab(newValue);
    }
    const classes = useStyles();
    return (
        //Css baseline set css standards
        <Box>
            <AppBar position="relative">
                <Toolbar>
                    <Typography variant="h6">
                        ProMiSE
                    </Typography>
                </Toolbar>
            </AppBar>
            <main>
            <div className={classes.container}>
                <Container maxWidth="md">
                    <Typography variant="h2" align="center" color="textPrimary" gutterBottom>
                    ProMiSE participant overview
                    </Typography>
                    <Typography variant="h5"align="center"color="textSecondary" paragraph>
                    This website gives an overview of the different participants
                    </Typography>
                    <Tabs value = {selectedTab} onChange={handleChange} centered TabIndicatorProps={{style: {background:'grey'}}}>
                        <Tab label="List"/>
                        <Tab label="Filter"/>
                    </Tabs>
                </Container>
            </div>
            <Box width='100%'>
            </Box>
            {selectedTab === 0 && <ParticipantList/>}
            {selectedTab === 1 && <ParticipantFilter/>}
            </main>
            <footer className={classes.footer}>
                <Typography variant='h6' align="center">
                    Footer
                </Typography>
                <Typography variant="subtitle1" align="center" color="textSecondary">
                    To give the footer a purpose
                </Typography>
            </footer>
        </Box>
    );
}
export default App;
